import React from 'react';

function Canvas({forwardedRef}) {

  return (
    <div id="canvcont">
      <canvas
        width={1000}
        height={800}
        rdata-paper-resize="true"
        ref={forwardedRef} >
      </canvas>
      <div id="navi">THis is the overlay</div>
    </div>
  );

}

export default Canvas;
